impl Solution {
    pub fn minimum_beautiful_substrings(s: String) -> i32 {
        let mut powers_of_5 = vec![1];
        while powers_of_5.last().unwrap() < &33554432 { // 2^25 > 10^7 (max possible value in 15 bits of binary)
            powers_of_5.push(powers_of_5.last().unwrap() * 5);
        }

        let mut dp = vec![i32::MAX; s.len() + 1];
        dp[0] = 0;

        for i in 1..=s.len() {
            if s.as_bytes()[i - 1] == b'0' {
                continue;
            }

            let mut num = 0;
            for j in (0..i).rev() {
                num = num * 2 + (s.as_bytes()[j] - b'0') as i32;
                if powers_of_5.contains(&num) {
                    dp[i] = dp[i].min(dp[j] + 1);
                }
            }
        }

        if dp[s.len()] == i32::MAX {
            -1
        } else {
            dp[s.len()]
        }
    }
}
